import { Component } from '@angular/core';
import { NgForm } from '@angular/forms';
import { Participant, ParticipantsService } from '../participant.service';
@Component({
  selector: 'app-participant-register',
  templateUrl: './participant-register.component.html',
  styleUrls: ['./participant-register.component.css']
})
export class ParticipantRegisterComponent {
  participant: Participant = {
    name: '',
    email: '',
    phone: '',
    user: {
      username: '',
      password: ''
    }
  };

  loading = false;
  successMessage = '';
  errorMessage = '';

  constructor(private participantsService: ParticipantsService) {}

  onSubmit(form: NgForm) {
    this.successMessage = '';
    this.errorMessage = '';

    if (form.invalid) {
      this.errorMessage = 'Please fix validation errors before submitting.';
      return;
    }

    this.loading = true;

    this.participantsService.register(this.participant).subscribe({
      next: (res) => {
        this.successMessage = res?.message || 'Participant registered successfully';
        this.loading = false;
        form.resetForm();
        // re-initialize to avoid undefined nested object
        this.participant = { name: '', email: '', phone: '', user: { username: '', password: '' } };
      },
      error: (err) => {
        console.error('Registration error:', err);
        // err.error can be string or object depending on API
        if (err?.error) {
          if (typeof err.error === 'string') this.errorMessage = err.error;
          else if (err.error.message) this.errorMessage = err.error.message;
          else this.errorMessage = JSON.stringify(err.error);
        } else {
          this.errorMessage = `Server responded with status ${err.status}`;
        }
        this.loading = false;
      }
    });
  }
}
<div class="register-container">
  <form #participantForm="ngForm" (ngSubmit)="registerParticipant()" class="register-form">
    <h2>Register Participant</h2>

    <!-- Name -->
    <div class="form-group">
      <label>Name *</label>
      <input
        type="text"
        name="name"
        [(ngModel)]="participant.name"
        required
      />
    </div>

    <!-- Email -->
    <div class="form-group">
      <label>Email *</label>
      <input
        type="email"
        name="email"
        [(ngModel)]="participant.email"
        required
      />
    </div>

    <!-- Phone -->
    <div class="form-group">
      <label>Phone *</label>
      <input
        type="text"
        name="phone"
        [(ngModel)]="participant.phone"
        required
        pattern="^[0-9]{10}$"
      />
    </div>

    <!-- Username -->
    <div class="form-group">
      <label>Username *</label>
      <input
        type="text"
        name="username"
        [(ngModel)]="participant.user.username"
        required
      />
    </div>

    <!-- Password -->
    <div class="form-group">
      <label>Password *</label>
      <input
        type="password"
        name="password"
        [(ngModel)]="participant.user.password"
        required
        minlength="6"
      />
    </div>

    <!-- Submit Button -->
    <button type="submit" [disabled]="participantForm.invalid">
      Register Participant
    </button>
  </form>
</div>
